Description:
            THIS IS A TABLE-TOP MUFFLE KILN WITH A 10-DIGITS NON-LINEAR THERMOSTATIC TEMPERATURE REGULATOR AND WITH ONE SHELF. THIS KILN IS FULLY SUITABLE FOR HEATING UP ALL TYPES OF METALS, CLAYS, ENAMELS, GLASS AND OTHER MATERIALS. 
Technical specification:  
- Input:
230VAC /-10% version with EU/RUSSIA standard plug (two round pins  E).
230VAC /-10% version with UK/IRELAND standard 3-pin plug.
230VAC /-10% version with AUSTRALIA/NZ standard plug ADAPTER.
- Model - 2016;
- Power - 750 Watt;
- Chamber's dimensions in MM(inch) - 135(5.1/2")W x 100(4")H x 90(3.1/2")D;
- Kiln's dimensions in MM(inch) - 190(7.1/2")W x 290(11.1/2")H x 190(7.1/2")D;
- Estimated top heating temperature: 950 C (1742 F);
- Secure switch to disconnect power supply when door is open;
- A non-linear thermostatic temperature regulator with two different heating options;
- Estimated heating time (to 950 C/1742 F) is about 45 minutes;
- Top open door position;
- One ceramic tile-plate;
- Cable - 1 Meter;
- Weight - 4.7 Kg.

  Delivery specification:

- R-11-950-2016 Kiln;
- One ceramic tile plate;
- One year manufacturer warranty.
